  def highestValuePalindrome(s: StringBuffer, n: Int, k: Int): StringBuffer = {
    var m = s
    if(k > s.length)
      m = changeChars(m,k)

    else
      m = changeChars(m,k)
    if(palindrom(m)){
      return m
    } else{
      return new StringBuffer("-1")
    }
    m
  }
  def changeChars(s:StringBuffer ,n:Int):StringBuffer ={
    var modif:StringBuffer = new StringBuffer("")
    var k=n
    var i=0
    if(k> s.length){
      println(s)
      for(k<-0 to s.length/2-1)
        modif = modif.append("99")
      if(s.length%2 ==1)
        modif =modif.append("9")
      println(modif)
    } else {
      modif = s
      while(k > 0 && i<= s.length/2){
        val hash = modif.toString.groupBy(_.toChar).map{p=>(p._1,p._2.length)}
        if(k == 1) {
          if(hash.filter(a=> a._2%2 == 1).nonEmpty){
            var mchar = hash.filter(a=> a._2%2 == 1).max._1
            var nchar= hash.filter(a=> a._2%2 == 1).min._1
            if(mchar== nchar){
              mchar = '9'
            }
            modif  = replaceCharAt(modif,modif.charAt(nchar),mchar)

          }
          k -=1
        } else {

          if(modif.charAt(i) != '9') {
            modif = replaceCharAt(modif,i,'9')
            k -=1
          }
          if(modif.charAt(modif.length-1-i) != '9') {
            modif = replaceCharAt(modif,modif.length-1-i,'9')
            k-=1
          }
          i +=1

        }

      }

    }

    modif
  }
  def replaceCharAt(s:StringBuffer, pos:Int, c:Char):StringBuffer = {
    return new StringBuffer(s.substring(0, pos)).append(c).append(new StringBuffer( s.substring(pos + 1)))
  }

  def palindrom (x:StringBuffer):Boolean ={
    for(i<-0 to  x.length/2){
      if(x.charAt((i)) != x.charAt(x.length-i-1)){
        return false
      }
    }
    true
  }
}
